import React from "react";
import {Select} from "@material-ui/core";
import InputLabel from '@material-ui/core/InputLabel';
import mock from '../mock.js'

const TestCaseDropdown = props => {
    return(
    <div>
        {props.integrationState === "Experian" ? (
      <div>
        <InputLabel htmlFor="exp-test-cases-native-simple">Test Cases</InputLabel>
        <Select 
          native
          value={props.testProfilesState} 
          onChange={e => props.settestProfilesState(e.target.value)}
          inputProps={{
            name: 'exp-test-cases',
            id: 'exp-test-cases-native-simple',
        }}
        >
          <option aria-label="None" value="" />
          <option value={props.testProfiles[0][0].name}>{props.testProfiles[0][0].name}</option>
          <option value={props.testProfiles[0][1].name}>{props.testProfiles[0][1].name}</option>
        </Select>
        </div>
    ) : null}
        {integrationState === "Equifax" ? (
      <div>
        <InputLabel htmlFor="exp-test-cases-native-simple">Test Cases</InputLabel>
        <Select 
          native
          value={testProfilesState} 
          onChange={e => settestProfilesState(e.target.value)}
          inputProps={{
            name: 'exp-test-cases',
            id: 'exp-test-cases-native-simple',
        }}
        >
          <option aria-label="None" value="" />
          <option value={testProfiles[2][0].name}>{testProfiles[2][0].name}</option>
          <option value={testProfiles[2][1].name}>{testProfiles[2][1].name}</option>
        </Select>
        </div>
    ) : null}
        {integrationState === "TransUnion" ? (
      <div>
        <InputLabel htmlFor="exp-test-cases-native-simple">Test Cases</InputLabel>
        <Select 
          native
          value={testProfilesState} 
          onChange={e => settestProfilesState(e.target.value)}
          inputProps={{
            name: 'exp-test-cases',
            id: 'exp-test-cases-native-simple',
        }}
        >
          <option aria-label="None" value="" />
          <option value={testProfiles[1][0].name}>{testProfiles[1][0].name}</option>
          <option value={testProfiles[1][1].name}>{testProfiles[1][1].name}</option>
        </Select>
        </div>
    ) : null}

    </div>
    )}

export default TestCaseDropdown
